(190, 'Raymond 	Brown', 'info@thecct', 0, 'Dear Sir/mdm, \r\n \r\nHow are you? \r\n \r\nWe supply N95, KN95, 3ply masks and Thermal cameras for Body Temperature Measurement up to accuracy of Â±0.1?C \r\nAdvantages of thermal imaging detection: \r\n \r\n1. Intuitive, efficient and convenient, making users directly &#34;see&#34; the temperature variation. \r\n2. Thermal condition of different locations for comprehensive analysis, providing more information for judgment \r\n3. Avoiding judgment errors, reducing labor costs, and discovering poor heat dissipation and hidden trouble points \r\n4. PC software for data analysis and report output \r\n \r\nWhatsapp: +65 87695655 \r\nTelegram: cctv_hub \r\nSkype: cctvhub \r\nEmail: sales@thecctvhub.com \r\nW: http://www.thecctvhub.com/ \r\n \r\nIf you do not wish to receive email from us again, please let us know by replying. \r\n \r\nregards, \r\nRaymond'),
(191, 'Raleigh', 'raleigh.dug', 699, '\r\nHave you had enough of expensive PPC advertising? Now you can post your ad on 10,000 ad websites and it&#39;ll cost you less than $40. Never pay for traffic again! \r\n\r\nGet more info by visiting: http://www.adpostingrobot.xyz'),
(192, 'Monte', 'monte.prend', 318, 'Greetings, I was just taking a look at your website and filled out your contact form. The contact page on your site sends you these messages to your email account which is the reason you are reading through my message right now right? This is the most important accomplishment with any type of advertising, making people actually READ your advertisement and I did that just now with you! If you have an advertisement you would like to blast out to millions of websites via their contact forms in the US or anywhere in the world send me a quick note now, I can even focus on particular niches and my costs are very affordable. Shoot me an email here: trinitybeumer@gmail.com'),
(193, 'GeorgeWhome', 'bradbroker1', 0, 'Are you looking to sell your HVAC business? Now is the time! We have buyers available right now looking to purchase a business like yours. Now is the time to buy with uncertainty on the future so high and with investor still having some money to invest. Let us go to work for you today - we have buyers ready to make you an offer today. Our buyers are specifically looking for HVAC companies. \r\n \r\nIf you are an HVAC company, we can sell your business no matter what state you are in - however, if you are any other type of business, then we can only sell your business if you are located in Illinois. \r\n \r\nEmail us today to connect  at: \r\n \r\nbrad@ilbusinessbroker.com'),
(194, 'JamesMoria', 'coronavacci', 0, 'COVID-19 outbreak: airplanes grounded, borders closed, businesses shut, citizens quarantined, political power seized, democracy undermined. \r\nAll this, if it is not stopped shortly, can lead to chaos and unrests. \r\nCurrently http://ST-lF.NET focus on raising awareness of the social impact that radically politicized approach to handling CoronaVirus Pandemic will have on the younger generations. \r\nYour support is needed to reduce the destructive impact the lock-down brings to bear on the younger generation. \r\nEvery 1$ makes a difference. \r\nPlease, take a moment to watch our presentation video and review our campaigns http://ST-lF.NET'),
(195, 'Cristina', 'gilruth.cri', 0, '\r\nQuit paying tons of cash for overpriced Facebook ads! We&#39;ve got a platform that charges only a very small payment and produces an almost endless volume of web traffic to your website\r\n\r\nFor more information just visit: http://bit.ly/adpostingrobot'),
(196, 'David Biton', 'david@graph', 0, 'Shalom, David here. \r\n \r\nYour website and business look great and both seem well established. \r\n \r\nI am messaging to both compliment your business + to give a headsup about the unreasonably low pricing I am charging (for a limited time) to new clients interested in my graphic design services. \r\n \r\nReply back to say Hi, ask to see my portfolio, or visit my site. \r\n \r\nEmail me: david@graphicdesignisrael.co \r\nWebsite: http://GraphicDesignIsrael.co'),
(197, 'Trevor', 'trevor.rose', 373, 'Hello, I was wondering if you would like to find out more about email ads that literally promises that you will make sales? No BS we have customers for virtually any business type! Take a look: https://bit.ly/guaranteed-sales-and-leads'),
(198, 'Judy', 'judy999887@', 34262, 'Hi there,\r\n\r\nI hope youâ€™re doing well, I handle influencer relations for LeggingsHut. Great to meet you!\r\n\r\nI stumbled across your account and thought your content would be perfect for us. If you feel weâ€™d make a good fit, Iâ€™d love to invite you to our referral program.\r\n\r\nUse this link to visit, http://leggingscashteam.com\r\n\r\n\r\nSincerely,\r\n\r\nLeggingsHut\r\nJudy'),
(199, 'SteveFus', 'bitclaybtc@', 0, 'Blockchain system automatically credits up to 11 bitcoins every 2 days to each participantÂ  \r\n \r\nHow it works:Â Â  \r\n \r\nFill out the registration form in the project. \r\n \r\nEnter the address of the Bitcoin wallet (the one to which payments from the project will come) \r\n \r\nIndicate the correct e-mail address for communication. \r\n \r\nRead the FAQ section and get rich along with other project participants. \r\nGet + 10% every 2 days to your personal Bitcoin wallet in addition to your balance. \r\n \r\n \r\nRegister and receive a guaranteed payment from 0,0075 BTC to 11 BTC:Â Â  \r\nhttps://www.crypto-mmm.com/?source=getbitcoÂ  \r\n \r\n \r\nThere are no restrictions - your bitcoins in your personal bitcoin wallet are available for use 24 hours a day!'),
(200, 'Dave Willis', 'no-reply@gm', 0, 'Hello, \r\n \r\nWe have available the following, with low minimum order requirements - if you or anyone you know is in need: \r\n \r\n-3ply Disposable Masks \r\n-KN95 masks and N95 masks with FDA, CE certificate \r\n-Gloves, Gowns \r\n-Sanitizing Wipes, Hand Sanitizer \r\n-Face Shields \r\n-Orla and No Touch Thermometers \r\n \r\n \r\nDetails: \r\nWe are based in the US \r\nAll products are produced in China \r\nWe are shipping out every day. \r\nMinimum order size varies by product \r\nWe can prepare container loads and ship via AIR or SEA. \r\n \r\nPlease reply back with the product you need , the quantity needed, and the best contact phone number to call you \r\ndavewillis2008@gmail.com \r\n \r\nThank you \r\n \r\nDave Willis \r\nProduct Specialist');
